Which beer factories are located in North Rhine-Westphalia? 

 Transformed SPARQL query:
 SELECT DISTINCT ?uri WHERE {
 ?uri a wd:Q131734 . // a brewery.
 ?uri wdt:P159 wd:Q1198 . // located in North Rhine-Westphalia.
 } 

 And the transformed query for the second SPARQL query:

 Which authors wrote the Harry Potter series? 

 Transformed SPARQL query:
 SELECT DISTINCT ?uri WHERE {
 ?uri wdt:P50 wd:Q8337 . // has author J.K. Rowling.
 } 

 (Note that wd:Q8337 represents the entity for J.K. Rowling in Wikidata.)

